import { ChallengeDTO, ChallengeRider } from '../../sdk';
import { jsPDF } from 'jspdf';
import { capitalizeFirstLetter } from '../../util';
import moment from 'moment';
import autoTable from 'jspdf-autotable';
import _ from 'lodash';

const tropheeOR =
  'data:image/png;base64,';
const tropheeArgent =
  'data:image/png;base64,';
const tropheeBronze =
  'data:image/png;base64,';
export const getAllCates = (rRaces, gender?) =>
  _.uniqBy(
    _.flatMap(gender ? rRaces.filter(r => r.gender === gender) : rRaces, rr => rr.challengeRaceRows),
    'catev'
  )
    .map(c => c.catev)
    .sort();

export const getAllGenders = rRaces =>
  _.uniqBy(
    _.flatMap(rRaces, rr => rr.challengeRaceRows),
    'gender'
  ).map(c => c.gender);

function getRowsForGenderAndCate(rowRaces: ChallengeRider[], gender: string, catev: string) {
  const onlyGender = rowRaces.filter(rr => rr.gender === gender) as any;

  return onlyGender
    .filter(r => r.currentLicenceCatev === catev)
    .map((r, index) => {
      return [
        index++ + 1,
        r.name,
        r.firstName,
        r.currentClub,
        r.currentLicenceCatev,
        r.currentLicenceCatea,
        r.ptsAllRaces
      ];
    });
}

export const exportPdf = (challenge: ChallengeDTO, rowRaces: ChallengeRider[]) => {
  let firstTable = true;
  const doc = new jsPDF({ orientation: 'p', unit: 'mm', format: 'a4', compress: true });
  const totalPagesExp = '{total_pages_count_string}';
  // Header
  doc.setFontSize(13);
  doc.setTextColor(40);
  //doc.setFontStyle('normal');
  doc.addImage(
    'data:image/png;base64,',
    'JPEG',
    10,
    5,
    30,
    21
  );
  doc.setFontSize(10);
  doc.text('Résultats générés avec Open Dossard (https://www.opendossard.com)', 50, 7);
  doc.setFontSize(13);
  doc.text(`Challenge : ${challenge.name}`, 50, 15);
  doc.text(
    'Date : ' +
      capitalizeFirstLetter(
        moment()
          .locale('fr')
          .format('dddd DD MMM YYYY')
      ),
    50,
    20
  );

  function generateTableForCate(data) {
    autoTable(doc, {
      head: [['Clt.', 'Nom', 'Prénom', 'Club', 'Caté actuelle', 'Caté age', 'Points']],
      headStyles: {
        fontSize: 9,
        fontStyle: 'bold',
        halign: 'left',
        cellPadding: 0.5,
        minCellHeight: 8
      },
      bodyStyles: {
        minCellHeight: 6,
        cellPadding: 0.5
      },
      columnStyles: {
        0: { cellWidth: 'auto' },
        1: { cellWidth: 'auto' },
        2: { cellWidth: 'auto' },
        3: { cellWidth: 'auto' },
        4: { cellWidth: 'auto' },
        5: { cellWidth: 'auto' },
        6: { cellWidth: 'auto' }
      },
      body: data,
      didDrawCell: function(data) {
        if (data.section === 'body' && data.column.index === 0 && data.row.index === 0) {
          doc.addImage(tropheeOR, 'PNG', data.cell.x, data.cell.y + 1, 5, 5);
        }
        if (data.section === 'body' && data.column.index === 0 && data.row.index === 1) {
          doc.addImage(tropheeArgent, 'PNG', data.cell.x, data.cell.y + 1, 5, 5);
        }
        if (data.section === 'body' && data.column.index === 0 && data.row.index === 2) {
          doc.addImage(tropheeBronze, 'PNG', data.cell.x, data.cell.y + 1, 5, 5);
        }
      },
      didDrawPage: (data: any) => {
        // Footer
        var str = 'Page ' + doc.internal.pages.length;
        doc.setFontSize(10);

        // jsPDF 1.4+ uses getHeight, <1.4 uses .height
        var pageSize = doc.internal.pageSize;
        var pageHeight = pageSize.height ? pageSize.height : pageSize.getHeight();
        doc.text(str, data.settings.margin.left, pageHeight - 10);
      },
      startY: firstTable ? 30 : 10,
      margin: { top: 10, left: 5, right: 5 },
      pageBreak: 'auto',
      rowPageBreak: 'avoid',
      styles: {
        valign: 'middle',
        halign: 'left',
        fontSize: 10,
        minCellHeight: 10
      }
    });
  }
  const allCatesH = getAllCates(rowRaces, 'H');
  let index = 0;

  for (const catev of allCatesH) {
    generateTableForCate(getRowsForGenderAndCate(rowRaces, 'H', catev));
    firstTable = false;
    index++;
    doc.addPage();
  }
  const allCatesF = getAllCates(rowRaces, 'F');
  index = 0;
  for (const catev of allCatesF) {
    generateTableForCate(getRowsForGenderAndCate(rowRaces, 'F', catev));
    index++;
    if (index < allCatesF.length) doc.addPage();
  }

  doc.save(`Clt_${challenge.name.replace(/\s/g, '')}.pdf`);
};
